import{_ as t,c as a,o,j as e,a as s}from"./chunks/framework.BoviJh-n.js";const b=JSON.parse('{"title":"关于我们","description":"","frontmatter":{},"headers":[],"relativePath":"about.md","filePath":"about.md"}'),n={name:"about.md"},r=e("h1",{id:"关于我们",tabindex:"-1"},[s("关于我们 "),e("a",{class:"header-anchor",href:"#关于我们","aria-label":'Permalink to "关于我们"'},"​")],-1),c=e("p",null,"程序设计工作室是隶属于信息工程学院的专业类工作室，由邱少明、白志慧两位老师指导，活动地点在明德A117机房。工作室主要参加ACM（ICPC，CCPC）、辽宁省大学生程序设计竞赛、团体程序设计天梯赛、蓝桥杯大赛等竞赛。上一年在CCPC秦皇岛站，女生专场中各获得铜牌一项，在ICPC全国邀请赛（武汉）获得银牌一项，ICPC全国邀请赛（陕西）中获得铜牌两项，CCPC全国邀请赛（郑州）中获得金牌一项，CCPC全国邀请赛（山东）获得金牌一项，银牌一项。在辽宁省大学生程序设计竞赛中获得一等奖3项，二等奖3项，三等奖4项。天梯赛“华山论剑”组全国团队二等奖，全国个人二等奖1项，全国个人三等奖4项，辽宁省“华山论剑”组亚军。今年蓝桥杯大赛，工作室成员斩获国家一等奖1项，二等奖4项，三等奖6项，省级奖项若干。每年工作室优秀同学会辅导信息学院新生的C语言晚自习，帮助新生更好的学习C语言。",-1),C=e("p",null,"工作室同时也开发各类应用软件，目前正在开发我校的毕业设计系统和督导办公系统。同时，由指导教师和高年级同学带领新同学做项目，优秀的同学有一些目前在字节跳动、携程、腾讯、网易、哔哩哔哩、滴滴、德勤、西山居、吉比特、龙图游戏等知名企业工作，还有一些通过考研进入中科大、中科院、北邮、哈工大、杭电、大连理工、东北大学等知名高校。",-1),_=e("p",null,"工作室每年分别在11月和4月举办两场ACM校赛，既提高我校同学编程水平，同时也借此进行校预备队和工作室正式成员的纳新。同时会为正式进入校队的同学晚自习请假。工作室有良好的场地、丰富的计算机资源、无打扰的自习环境、可以提供内推的学长，等着你们来加入！",-1),d=[r,c,C,_];function i(l,p,h,u,m,P){return o(),a("div",null,d)}const x=t(n,[["render",i]]);export{b as __pageData,x as default};
